import React from 'react';
import './App.css';

import Technologies from './Technologies.js';


const App = () => {
    return (
        <div className={'app-wrapper'}>
            <header>
                <img src="https://j-older.github.io/Projects/logo.svg" alt=""/>
            </header>

            <nav className={'menuItem'}>
                <div>Profile</div>
                <div>Message</div>
                <div>News</div>
                <div>Music</div>
                <div>Setting</div>
            </nav>

            <div className={'mainContent'}>
                <img src="https://img3.goodfon.ru/wallpaper/nbig/3/77/gorod-osen-mokrye-ulitsy-doma.jpg" alt=""/>
                Main content
            </div>

        </div>
    );
};


export default App;
